import React from 'react'
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardMedia from "@material-ui/core/CardMedia";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import CardActions from "@material-ui/core/CardActions";
import Button from "@material-ui/core/Button";
import useStyles from "./Compositions.style";

function CompositionList({compositions, ...props}) {
    const classes = useStyles()
    let compositionNodes = compositions.map(c => (
        <Grid key={c.id} item xs={3}>
            <Card className={classes.compCard}>
                <CardActionArea>
                    <CardMedia
                        component="img"
                        alt={c.title}
                        height="174"
                        image={c.thumbnail}
                    />
                </CardActionArea>
                <CardContent className={classes.compCardContent}>
                    <Typography gutterBottom variant="h5" component="h3" noWrap title={c.title}>
                        {c.title}eeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeee
                    </Typography>
                    <Typography variant="body2" color="textSecondary" component="p" noWrap title={`${c.price} $`}>
                        {c.price} $
                    </Typography>
                </CardContent>
                <CardActions disableSpacing={true}>
                    <Button size="small">
                        View
                    </Button>
                </CardActions>
            </Card>
        </Grid>
    ))

    return (
        <Grid container className={classes.root}>
            <Grid item xs={12}>
                <Grid container justify="center">
                    {/*{compositionNodes}*/}
                </Grid>
            </Grid>
        </Grid>
    );
}

export default CompositionList
